  false,\n\t\"url\": null,\n\t\"notes\": \"Single-beam bathymetry,gravity, and magnetic
  data along with transit satellite navigation data was collected as part of field
  activity UGEOLEG_4 (U-4-71-CB) in Venezuela, Caribbean Sea from 08/18/1971 to 10/01/1971,
  http://walrus.wr.usgs.gov/infobank/u/u471cb/html/u-4-71-cb.meta.html These data
  are reformatted from space-delimited ASCII text files located in the Coastal and
  Marine Geology Program (CMGP) InfoBank field activity catalog at http://walrus.wr.usgs.gov/infobank/u/u471cb/html/u-4-71-cb.bath.html
  http://walrus.wr.usgs.gov/infobank/u/u471cb/html/u-4-71-cb.grav.html and http://walrus.wr.usgs.gov/infobank/u/u471cb/html/u-4-71-cb.mag.html
  into MGD77T format provided by the NOAA's National Geophysical Data Center(NGDC).
  The MGD77T format includes a header (documentation) file (.h77t) and a data file
  (.m77t). More information regarding this format can be found in the publication
  listed in the Cross_reference section of this metadata file.\",\n\t\"license_title\":
